import React from "react";

function List(props) {
  return (
    <ul>
      {props.items.map((item) => {
        return (
          <li key={item.id}>
            {item.value}
            <button onClick={() => props.removeItem(item.id)}>
              <DeleteIcon />
            </button>
          </li>
        );
      })}
    </ul>
  );
}

export default List;
